Quote The simplest intuition for types is that they are set of values. Here, sets can be finite or infinite. Ideally we can consider types to be sets and functions to be mathematical functions between sets. But we will encounter the halting problem since there are functions that never terminate. That is why we introduce \(\bot\), which means a non-terminating computation. So a function with the following signature: fn f(x: bool) -> bool {} may return true, false, or \(\bot\). For example, the following program: fn f(x: bool) -> bool { !f(x)
} fn main() { println!("{}", f(true));
} compiles but never terminate. Such functions are called partial functions , as opposed to total functions , which return valid results for every possible argument.

